package main

import "fmt"

type MaxHeap struct {
    size int
    count int
    nums []int //first ele empty 
}

func Construct(k int) *MaxHeap {
    heap := &MaxHeap{}
    heap.size = k
    heap.count = 0
    heap.nums = make([]int, k+1)
    return heap
}

func (self *MaxHeap)Insert(num int) {
    if self.count == self.size {
	if num > self.nums[1] {
	    return
	}
	self.Replace(num)
	return
    }

    self.count++
    self.nums[self.count] = num
    cursor := self.count
    //heapify from bottom 2 top
    for cursor > 1 {
	parent := cursor / 2
	if self.nums[parent] < self.nums[cursor] {
	    swap(self.nums, parent, cursor)
	    cursor = parent
	}else {
	    break
	}
    }
}

func (self *MaxHeap) Replace(num int) {
    self.nums[1] = num
    //heapify from top 2 bottom
    cursor := 1
    for cursor * 2 <= self.count {
	left, right := cursor * 2, cursor * 2 + 1
	maxIndex, max := cursor, self.nums[cursor]
	if max < self.nums[left] {
	    maxIndex = left
	    max = self.nums[left]
	}

	if right <= self.count && max < self.nums[right] {
	    maxIndex = right
	    max = self.nums[right]
	}

	if maxIndex == cursor {
	    return 
	}

	swap(self.nums, cursor, maxIndex)
	cursor = maxIndex
    }
}

func swap(nums []int, a, b int) {
    nums[a], nums[b] = nums[b], nums[a]
}

func getLeastNumbers(arr []int, k int) []int {
    if len(arr) <= k {
	return arr
    }

    if k <= 0 {
	return []int{}
    }

    maxHeap := Construct(k)
    for _, num := range arr {
	maxHeap.Insert(num)
//	fmt.Println(maxHeap.nums)
    }

    return maxHeap.nums[1:]
}

